import { styled } from "styled-components";

export const StyledTetrisWrapper = styled.div`
    width: 100%;
    height: 100%;
    overflow: hidden;
`

export const StyledTetris = styled.div`
    display: flex;
    align-items: center;
    background-color: aliceblue;
    margin: 0 auto;
`
